import React, { useState } from 'react'
import { Link, useNavigate } from 'react-router-dom'

import GoogleLogin from 'react-google-login';


export default function Login() {
  const [credentials, setcredentials] = useState({ email: "", password: "" })
  let navigate = useNavigate();
  const onChange = (event) => {
    setcredentials({ ...credentials, [event.target.name]: event.target.value })
  }





  const handleGoogleLoginSuccess = async (response) => {
    try {
      const email = response.profileObj.email;
      // Use the email to find the user's data in the database
      let userData = await User.findOne({ email });
      if (userData) {
        // Generate an authentication token and return it as a JSON response
        const data = { user: { id: userData.id } };
        const authToken = jwt.sign(data, jwtSecret);
        localStorage.setItem('userEmail', email);
        localStorage.setItem('authToken', authToken);
        navigate('/');
      } else {
        // The user is not registered yet
        navigate('/createuser');
      }
    } catch (error) {
      console.log(error);
      res.json({ success: false });
    }
  };

  const handleGoogleLoginFailure = (error) => {
    console.log(error);
    // Handle the error scenario
  };














  const handleSubmit = async (e) => {
    e.preventDefault();
    const response = await fetch("http://localhost:3000/api/loginuser/", {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json'
      },
      body: JSON.stringify({ email: credentials.email, password: credentials.password, googleToken: googleToken })
    });

    const json = await response.json();
    console.log(json);

    if (!json.success) {
      alert("Email or Password is incorrect");
    }
    else {
      localStorage.setItem("userEmail", credentials.email);
      localStorage.setItem("authToken", json.authToken);
      console.log(localStorage.getItem("authToken"));
      navigate("/");
    }
  }




  return (
    <div className='container'>
      <form onSubmit={handleSubmit}>

        <div className="mb-3">
          <label htmlFor="exampleInputEmail1" className="form-label">Email address</label>
          <input type="email" className="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" name="email" value={credentials.email} onChange={onChange} />
          <div id="emailHelp" className="form-text">We'll never share your email with anyone else.</div>
        </div>

        <div className="mb-3">
          <label htmlFor="exampleInputPassword1" className="form-label">Password</label>
          <input type="password" className="form-control" id="exampleInputPassword1" name="password" value={credentials.password} onChange={onChange} />
        </div>
        <button type="submit" className="btn btn-primary">Submit</button>
        <GoogleLogin
          clientId="585905077817-41hms8bbun2fmk7tu8m8t2fq5r607884.apps.googleusercontent.com"
          buttonText="Sign in with Google"
          onSuccess={handleGoogleLoginSuccess}
          onFailure={handleGoogleLoginFailure}
          cookiePolicy={'single_host_origin'}
        />

        <Link to="/createuser" className="m-2 btn btn-danger "> I'm a new User</Link>
      </form>
    </div>
  )
}
